function code_format(){var e=document.getElementById("new-template").innerHTML,t=Handlebars.compile(e),n=document.getElementById("format_string").value,o=document.getElementById("filename").value;axios({method:"post",url:"/process_file_backend",data:{filename:o,format:n}}).then(function(e){var n=new Date;var o={runTime:String(n.toLocaleTimeString("en-us",{weekday:"long",year:"numeric",month:"short",day:"numeric",hour:"2-digit",minute:"2-digit"})),body:e.data};console.log(o);var a=t(o),i=document.getElementById("results_set");i.innerHTML=a,i.scrollIntoView(),new ClipboardJS(".button").on("success",function(e){alert("Copied!")})}).catch(e=>console.log(e))}